import { Formik, Field, Form } from 'formik';


function FormComponent() {
  return (
    <>
        <Formik initialValues={{
            firstName:'',
            lastName:'',
            email:'',
            password: '',
            userImg: '',
        }}>
            <Button variant="contained" color="success">
            Success
            </Button>
            <Button variant="outlined" color="error">
            Error
            </Button>
        </Formik>
    </>
  );
}

export default FormComponent;
